import "./index.css";
import React from "react";

function About() {
  return (
    <div className="flex justify-center items-center flex-col">
      <h1 className="justify-start text-3xl">Resume</h1>
      <p>I'm Front-end developer</p>
      <p className="justify-center">
        Experienced Embedded C Developer transitioning to Full-Stack
        Development,
        <br />
        equipped with strong React(using redux), JavaScript, HTML, and CSS
        skills,
        <br />
        adept at creating responsive web applications, committed to continuous
        <br />
        learning and collaboration for delivering visually appealing user
        <br />
        interfaces in a dynamic team environment
      </p>
      <p>This is a paragraph with line breaks.</p>
    </div>
  );
}

export default About;
